//react libraries
import React, { Component } from "react";
import ReactDOM from 'react-dom';
import './../index.css';

//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';

class Banner extends Component {
  render(){
    return(
      <h1>darelist</h1>
    );
  }
}

export default Banner;
